import '../css/skills.css'
import html from '../img/html.png'

function Skills(){
    return(
        <div>
            <div className="container skills">
                <h4 className='titleSkills'>skills()</h4>
                <img src={html} alt="" />
            </div>
        </div>
    )
}

export default Skills;
